import React from 'react';


function Card(props) {
  console.log(props.robots);

  return (
    <div className="card">
  	  <img src='https://robohash.org/test?200x200' />
  	  <p>{props.robots.name}</p>
  	  <p>{props.robots.email}</p>        
    </div>
  );
}

export default Card;
